import React from "react";
import Quotes from './quotes.json';


function QuoteReader() {
    Quotes.map( quote => {
        return (
            <div>
                <h1>
                { quote.quotes }
                </h1>
            </div>
        )
    })
}

const Quote = () => {

    return (
        {QuoteReader}
    );
};

export default Quote;
